      out.write("<!-- 音乐播放控制 -->\r\n");
      out.write("<script type=\"text/javascript\">\r\n");
      out.write("    // 获取音频标签对象\r\n");
      out.write("    // var _audio = $('#aud')[0];\r\n");
      out.write("    var _audio = new Audio();\r\n");
      out.write("\r\n");
      out.write("    // 控制 首页发现歌曲 和 歌曲展示页面 的播放暂停按键函数使用 ，值为 id\r\n");
      out.write("    var song_url_s;\r\n");
      out.write("    var song_icon_id;\r\n");
      out.write("\r\n");
      out.write("    // 控制 首页最新歌曲的播放暂停按键函数使用 ，值为 id\r\n");
      out.write("    var song_url_s_new;\r\n");
      out.write("\r\n");
      out.write("    // (s_name, s_name_singer, s_id_singer, s_album_img) 设置四个数组，用于播放下一曲时 赋值播放列表\r\n");
      out.write("    var s_name_arr =  [];\r\n");
      out.write("    var s_name_singer_arr =  [];\r\n");
      out.write("    var s_id_singer_arr =  [];\r\n");
      out.write("    var s_album_img_arr =  [];\r\n");
      out.write("\r\n");
      out.write("\r\n");
      out.write("\r\n");
      out.write("    // 总时间\r\n");
      out.write("    var duration;\r\n");
      out.write("\r\n");
      out.write("    // 获取播放和暂停\r\n");
      out.write("    var play = $('#playA');\r\n");
      out.write("    var pause = $('#playB');\r\n");
      out.write("    // 当前时间\r\n");
      out.write("    var currenttime = _audio.currentTime;\r\n");
      out.write("\r\n");
      out.write("    //音乐进度条\r\n");
      out.write("    var p_percent = '0%';\r\n");
      out.write("\r\n");
      out.write("\r\n");
      out.write("    // 进度条背景坐标位置\r\n");
      out.write("    var odiv = document.getElementById('progressbar_bg');\r\n");
      out.write("    var pro_lx = odiv.getBoundingClientRect().left;\r\n");
      out.write("    var pro_top = odiv.getBoundingClientRect().top;\r\n");
      out.write("    var pro_rx = odiv.getBoundingClientRect().right;\r\n");
      out.write("\r\n");
      out.write("    //进度条总长度\r\n");
      out.write("    var p_length = pro_rx - pro_lx;\r\n");
      out.write("\r\n");
      out.write("    // 获取声音键\r\n");
      out.write("    var mute = $('#muteA');\r\n");
      out.write("    var unmute = $('#muteB');\r\n");
      out.write("\r\n");
      out.write("    // 循环按钮\r\n");
      out.write("    var repeatA = $('#repeatA');\r\n");
      out.write("    var repeatB = $('#repeatB');\r\n");
      out.write("\r\n");
      out.write("\r\n");
      out.write("    // 全局开始\r\n");
      out.write("    var str = \"/music/songs/Kevin Kern/Endless Blue Sky/Kevin Kern - Always Near.mp3\";\r\n");
      out.write("    var str1 = \"/music/songs/Kevin Kern/In My Life/Kevin Kern - Bittersweet.mp3\";\r\n");
      out.write("    var arr = [str];\r\n");
      out.write("\r\n");
      out.write("    $(document).ready(function () {\r\n");
      out.write("\r\n");
      out.write("        // 播放列表\r\n");
      out.write("        // 清空原始的\r\n");
      out.write("        console.log(\"清空播放列表前\");\r\n");
      out.write("        $('#playlist_ul').empty();\r\n");
      out.write("        console.log(\"清空播放列表后\");\r\n");
      out.write("\r\n");
      out.write("        console.log(\"加载前\" + arr.length);\r\n");
      out.write("        music(_audio, arr.pop());\r\n");
      out.write("        _audio.addEventListener('ended', playEndedHandler, false);\r\n");
      out.write("        console.log(\"加载后\" + arr.length);\r\n");
      out.write("\r\n");
      out.write("\r\n");
      out.write("    });\r\n");
      out.write("\r\n");
      out.write("    function playEndedHandler() {\r\n");
      out.write("        _audio.load();\r\n");
      out.write("        console.log(\"执行playEndedHandler方法前\");\r\n");
      out.write("        console.log(\"真正播放前arr长度：\" + arr.length);\r\n");
      out.write("        // console.log(\"真正播放前\" + arr);\r\n");
      out.write("\r\n");
      out.write("        _audio.src = arr.pop();\r\n");
      out.write("        console.log(\"真正播放后arr数组长度\" + arr.length);\r\n");
      out.write("        // console.log(\"真正播放后\" + arr);\r\n");
      out.write("        // console.log(_audio.src);\r\n");
      out.write("\r\n");
      out.write("        getSongs_info_play(s_name_arr.pop(),s_name_singer_arr.pop(),s_id_singer_arr.pop(),s_album_img_arr.pop())\r\n");
      out.write("\r\n");
      out.write("        _audio.play();\r\n");
      out.write("        play.addClass(\" hid\");\r\n");
      out.write("        pause.removeClass(\" hid\");\r\n");
      out.write("        // console.log(arr.length);\r\n");
      out.write("        !arr.length && _audio.removeEventListener('ended', playEndedHandler, false);//只有一个元素时解除绑定\r\n");
      out.write("        console.log(\"执行playEndedHandler方法后\");\r\n");
      out.write("    };\r\n");
      out.write("\r\n");
      out.write("\r\n");
      out.write("    function music(audio, url) {\r\n");
      out.write("        _audio.src = url;\r\n");
      out.write("        console.log(\"加载中\");\r\n");
      out.write("        $('#jplayer_N').empty();\r\n");
      out.write("\r\n");
      out.write("        // 最开始赋值歌曲两个时间\r\n");
      out.write("        audio.load();\r\n");
      out.write("\r\n");
      out.write("        audio.oncanplay = function () {\r\n");
      out.write("            var d = audio.duration;\r\n");
      out.write("            // alert(d);\r\n");
      out.write("            duration = d;\r\n");
      out.write("            // alert(duration);\r\n");
      out.write("            $('#currenttime').text(calTime(currenttime));\r\n");
      out.write("            $('#duration').text(calTime(duration));\r\n");
      out.write("        };\r\n");
      out.write("    }\r\n");
      out.write("\r\n");
      out.write("\r\n");
      out.write("    // 鼠标在进度条上移动(失败)\r\n");
      out.write("    odiv.onmousemove = function (e) {\r\n");
      out.write("        // var loc = \"当前位置 x:\"+e.pageX+\",y:\"+e.pageY;\r\n");
      out.write("        // console.log(loc);\r\n");
      out.write("        // 鼠标x，y位置\r\n");
      out.write("        var mx = e.pageX;\r\n");
      out.write("        var my = e.pageY;\r\n");
      out.write("        // console.log(mx,my);\r\n");
      out.write("    };\r\n");
      out.write("\r\n");
      out.write("    // 鼠标在进度条上按下事件跳到指定时间播放\r\n");
      out.write("    odiv.onmousedown = function (e) {\r\n");
      out.write("        // 鼠标x，y位置\r\n");
      out.write("        var mx = e.pageX;\r\n");
      out.write("        var my = e.pageY;\r\n");
      out.write("        // 当前鼠标点击位置的百分比\r\n");
      out.write("        var l_p = (mx - pro_lx) / p_length;\r\n");
      out.write("        var l_p1 = l_p.toFixed(2);\r\n");
      out.write("        // 赋值当前获取的播放时间\r\n");
      out.write("        currenttime = duration * l_p1;\r\n");
      out.write("        console.log(duration);\r\n");
      out.write("        p_percent = l_p1 * 100 + '%';\r\n");
      out.write("        // 设置当前播放时间\r\n");
      out.write("        $('#currenttime').text(calTime(currenttime));\r\n");
      out.write("        // 设置进度条百分比\r\n");
      out.write("        $('#progressbar').width(p_percent);\r\n");
      out.write("        // 设置音频当前播放时间\r\n");
      out.write("        _audio.currentTime = currenttime;\r\n");
      out.write("\r\n");
      out.write("        // console.log(l_p1,currenttime);\r\n");
      out.write("    };\r\n");
      out.write("\r\n");
      out.write("\r\n");
      out.write("    //监听音频播放的实时时间事件\r\n");
      out.write("    _audio.addEventListener(\"timeupdate\", function () {\r\n");
      out.write("        // 音乐播放时候 获取当前时间\r\n");
      out.write("        currenttime = _audio.currentTime;\r\n");
      out.write("        // console.log(currenttime);\r\n");
      out.write("        $('#currenttime').text(calTime(currenttime));\r\n");
      out.write("\r\n");
      out.write("        // 进度条百分比\r\n");
      out.write("        // 百分比\r\n");
      out.write("        var p = (currenttime / duration).toFixed(3) * 100;\r\n");
      out.write("        // console.log(p);\r\n");
      out.write("        p_percent = p + '%';\r\n");
      out.write("\r\n");
      out.write("        // 设置进度条\r\n");
      out.write("        $('#progressbar').width(p_percent);\r\n");
      out.write("\r\n");
      out.write("\r\n");
      out.write("    }, false);\r\n");
      out.write("\r\n");
      out.write("    // 音频结束后把暂停按钮恢复到播放按钮\r\n");
      out.write("    _audio.onended = function () {\r\n");
      out.write("        // 设置暂停按钮为播放按钮\r\n");
      out.write("        pause.addClass(\" hid\");\r\n");
      out.write("        play.removeClass(\" hid\");\r\n");
      out.write("    };\r\n");
      out.write("\r\n");
      out.write("\r\n");
      out.write("    // 计算时间格式为分钟\r\n");
      out.write("    function calTime(times) {\r\n");
      out.write("        var time = times;\r\n");
      out.write("        //分钟\r\n");
      out.write("        var minute = time / 60;\r\n");
      out.write("        var minutes = parseInt(minute);\r\n");
      out.write("        if (minutes < 10) {\r\n");
      out.write("            minutes = \"0\" + minutes;\r\n");
      out.write("        }\r\n");
      out.write("        //秒\r\n");
      out.write("        var second = time % 60;\r\n");
      out.write("        var seconds = Math.round(second);\r\n");
      out.write("        if (seconds < 10) {\r\n");
      out.write("            seconds = \"0\" + seconds;\r\n");
      out.write("        }\r\n");
      out.write("\r\n");
      out.write("        //总共时长的秒数\r\n");
      out.write("        var allTime = parseInt(minutes * 60 + seconds);\r\n");
      out.write("        var timeString = minutes + ':' + seconds;\r\n");
      out.write("        // console.log(time,minutes,seconds,allTime);\r\n");
      out.write("        return timeString;\r\n");
      out.write("    }\r\n");
      out.write("\r\n");
      out.write("    // 播放按钮事件\r\n");
      out.write("    function playAudio(obj) {\r\n");
      out.write("        // 播放\r\n");
      out.write("        setTimeout(() => {\r\n");
      out.write("            _audio.play();\r\n");
